import React, { useState, useEffect, useCallback } from 'react';
import { Tabs, Tab, Button } from 'react-bootstrap';
import RecentOrders from './RecentOrders';
import InventoryComponent from './InventoryComponent';
import LogoutButton from './LogoutButton';
import StoreSettingsSidebar from './StoreSettingsSidebar';
import StoreNoticeComponent from './StoreNoticeComponent';
import UpdateDeliveryZoneComponent from './UpdateDeliveryZoneComponent';
import BusinessHoursComponent from './BusinessHoursComponent';
import MinOrderComponent from './MinOrderComponent';
import AccountPage from './AccountPage';
import { useLoadScript } from '@react-google-maps/api';
import { useAuth } from '../context/AuthContext'; // Use useAuth to access context
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const libraries = ['places'];

const defaultHours = {
  monday: '',
  tuesday: '',
  wednesday: '',
  thursday: '',
  friday: '',
  saturday: '',
  sunday: '',
};

const VendorDashboard = () => {
  const { logout } = useAuth();
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: 'AIzaSyBKb82KnQEbd1OGJxY08DbvsmRcz33h48w',
    libraries,
  });
  const navigate = useNavigate();

  const [vendorData, setVendorData] = useState({
    storeNotice: '',
    minOrder: 0,
    businessHours: defaultHours,
  });
  const [showSettings, setShowSettings] = useState(false);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const handleExpiredToken = () => {
    console.warn('Session expired. Logging out.');
    logout();
    navigate('/login');
  };

  const fetchVendorData = useCallback(async () => {
    setLoading(true);
    try {
      const response = await axios.get('http://localhost:5001/api/vendors/profile', {
        withCredentials: true,
      });

      const data = response.data;
      setVendorData({
        storeNotice: data.storeNotice ?? '',
        minOrder: data.minOrder || 0,
        businessHours: data.businessHours || defaultHours,
      });
      setError(null);
    } catch (error) {
      console.error('Error fetching vendor data:', error.message);
      if (error.response?.status === 401) {
        handleExpiredToken();
      } else {
        setError('Failed to fetch vendor data.');
      }
    } finally {
      setLoading(false);
    }
  }, [handleExpiredToken]);

  useEffect(() => {
    fetchVendorData();
  }, [fetchVendorData]);

  const handleUpdateNotice = async (newNotice) => {
    try {
      const response = await axios.put(
        'http://localhost:5001/api/vendors/store-notice',
        { storeNotice: newNotice },
        { withCredentials: true }
      );

      if (response.status === 200) {
        alert('Store notice updated successfully!');
        setVendorData((prevData) => ({
          ...prevData,
          storeNotice: newNotice,
        }));
      } else {
        alert('Failed to update store notice.');
      }
    } catch (error) {
      console.error('Error updating store notice:', error);
      alert('An error occurred.');
    }
  };

  if (loading) return <div>Loading...</div>;
  if (loadError) return <div>Error loading maps</div>;

  return (
    <div>
      <div className="d-flex justify-content-between align-items-center m-4">
        <h2 className="flex-grow-1 text-center">Vendor Dashboard</h2>
        <Button variant="secondary" onClick={() => setShowSettings(true)}>
          Store Settings
        </Button>
        <LogoutButton />
      </div>
      {error && <div className="alert alert-danger">{error}</div>}
      <Tabs defaultActiveKey="orders" id="vendor-dashboard-tabs" className="mb-3">
        <Tab eventKey="orders" title="Orders">
          <RecentOrders />
        </Tab>
        <Tab eventKey="inventory" title="Inventory">
          <InventoryComponent />
        </Tab>
        <Tab eventKey="profile" title="Profile">
          <AccountPage />
        </Tab>
      </Tabs>
      <StoreSettingsSidebar show={showSettings} handleClose={() => setShowSettings(false)}>
        <StoreNoticeComponent
          initialNotice={vendorData.storeNotice}
          onUpdate={handleUpdateNotice}
        />
        <UpdateDeliveryZoneComponent isLoaded={isLoaded} loadError={loadError} />
      </StoreSettingsSidebar>
    </div>
  );
};

export default VendorDashboard;
